import React from "react";

export const Calculator = () => {
  const a = 10;
  const b = 12;
  return (
    <>
      <p>add{a + b}</p>
      <p>sub{a - b}</p>
      <p>mul{a * b}</p>
      <p>div{a / b}</p>
    </>
  );
};
const Challenge5 = () => {
  return (
    <>
      <h1>Calculator</h1>
      <ol>
        <li>Sum of two number is {a + b}</li>
        <li>Sub of two number is {a - b}</li>
        <li>Mul of two number is {a * b}</li>
        <li>Div of two number is {(a / b).toFixed(2)}</li>
      </ol>
    </>
  );
};

export default Challenge5;
